import React, { Component } from 'react'

export default class Register extends Component {
    constructor(props) {
        super(props);
        this.state = {
            username: '',
            password: '',
            phone: '',
            email: ''
        }
    }
    render() {
        return (
            <div className = 'container'>
                <form>
                    <input id='username' placeholder='Enter your name' value = {this.state.username} /> <br/>
                    <input id='email' placeholder='Enter your email' value={this.state.email} /> <br/>
                    <input id='phone' placeholder='Enter your phone number' value={this.state.phone} /> <br/>
                    <input type='password' id='password' placeholder='Enter you password' value={this.state.password} /> <br/>
                </form>
            </div>
        )
    }
}
